    "2016-08-05T07:12:22.644645",nt"name": "cdc039s-social-vulnerability-index-svi",nt"isopen":
    false,nt"url": null,nt"notes": "<p>Social vulnerability refers to the resilience
    of communities when confronted by external stresses on human health, stresses such
    as natural or human-caused disasters, or disease outbreaks. Reducing social vulnerability
    can decrease both human suffering and economic loss. ATSDR's Social Vulnerability
    Index uses U.S. census variables at tract level to help local officials identify
    communities that may need support in preparing for hazards, or recovering from disaster.</p>n",nt"license_title":
